<template>
    <div class="btn-file">
      <img id="img_preview" class="circle responsive-img" :src="inputVal" />
      <input type="file" v-on:change="onUpdateFile"  />
  </div>
</template>
<script>
export default {
  name: "hi-image-picker",
  props: {
    modelValue: {
      type: String,
      default: "data:image/png;base64,"
    },
  },
  computed: {
    inputVal: {
      get() {
        return this.modelValue!=""?this.modelValue:"data:image/png;base64,";
      },
      set(val) {
        this.$emit("update:modelValue", val);
      },
    },
  },
  methods:{
     onUpdateFile(e){
        var files = e.target.files || e.dataTransfer.files;
        if (!files.length)
            return;

        this.createImage(files[0]);
      },
      async createImage(Myfile){

        var reader = new FileReader();

        reader.onload = this.changeImage;

        reader.readAsDataURL(Myfile);
      },
      changeImage(e){
        console.log(this.inputVal)
        this.inputVal =  e.target.result;
      }
  }
};
</script>
<style scoped>
.btn-file {
  position: relative;
  overflow: hidden;
}

.btn-file input[type="file"] {
  position: absolute;
  top: 0;
  right: 0;
  min-width: 100%;
  min-height: 100%;
  font-size: 100px;
  text-align: right;
  filter: alpha(opacity=0);
  opacity: 0;
  outline: none;
  background: white;
  cursor: inherit;
  display: block;
}
</style>
